#!/usr/bin/env python3# -*- coding: utf-8 -*-"""Created on Tue Feb 11 08:48:42 2025@author: cornelius"""from math import gcdfrom random import randintimport timedef f(x,n):    return (x**2 + 1) % ndef pollardRho(n):        x = randint(2,n-1)    y = x        d = 1        while d == 1:        x = f(x,n)        y = f(f(y,n),n)                d = gcd(abs(x-y),n)                if d == n:            return None            return d    # -----------------------------------------------------------------------#                               TESTING   # -----------------------------------------------------------------------n = 1372319802547       #    = 174440041*7867#                       Pollard p-1 Factorizationstart2 = time.time()primeFactor = pollardRho(n)end2 = time.time()runtime2 = end2 - start2print(f"Pollard p-1 Factor: {primeFactor}")print(f"Pollard p-1 Runtime:              {runtime2: .8f}s")    